The configuration parameter in the toml file called proxy_configuration_path will be read in and the raw bytes are accessible with the config bindings: use proxysaur_bindings::config; fn main() { let config_data: Vec<u8> = proxysaur_config::get_config_data(); ...
} If the data is invalid, you can use the set_invalid_data function which allows you to set a String error message: use proxysaur_bindings::config; fn main() { let config_data: Vec<u8> = proxysaur_config::get_config_data(); let config: Config = serde::from_bytes(&config_data).map_err(|err| { let msg = format!("Error serializing data: {}", err); config::set_invalid_data(msg); err }).unwrap();
}
